INSERT INTO `manage_faq` (`id`, `logo_title`, `logo_desc`, `logo_name`, `date`, `language`, `ptype`) VALUES
(1, 'WHAT ARE THE THREE WALLETS AND WHAT DO THEY COMPRISE?', '<p>The three wallets are :</p>\r\n\r\n                                                <ul class=\"uli\">\r\n                                                    <li>ROI wallet</li>\r\n                                                    <li>Working wallet</li>\r\n                                                    <li>Main wallet</li>\r\n                                                </ul>\r\n\r\n                                                <p>ROI wallet is a wallet that will reflect all your income collected as daily returns on investment (ROI).</p>\r\n\r\n                                                <p>Working wallet will contain all income that you have earned through Referral, Binary, Royalty, Rewards etc. so basically its a safe keep for holding all your incomes except the Daily ROI.</p>\r\n\r\n                                                <p>Main wallet on the other hand is like a fund of the member himself. User/member can add to that fund and store it, or this fund can also be used for transfer to downline or top-up to downline.</p>', 'F.A.Q', '2018-02-08 10:48:56', 'English', 'index1'),
(12, 'HOW WALLET TRANSFERS WORKS?', '<p>A user can use any of the three wallets for  making transfers. Track of all transfers both inward and outward will be maintained to enable complete transparency of transactions.</p>\r\n\r\n                                                <p>We do not charge any fees for making downline transfers.But if the user makes an up line transfer then such transfer will be charged @ 8% on the user.</p>\r\n\r\n                                                <p>The amount in Working wallet and the ROI Wallet can be transferred to any user and such amount will be credited to the Main wallet of the receiver.</p>\r\n\r\n                                                <p>While any amount transferred from Main Wallet will be credited to the Main Wallet of the receiver.</p>', 'F.A.Q', '2018-02-08 10:51:17', 'English', 'index1'),
(13, 'What is an inactive or expired account and how will it be treated?', '<p>A user account will be termed as inactive or expired after it reaches its expiry date. Such expiry date is the same date as package expiry. A user will not be allowed to process any withdrawal request after expiry of the account. After expiry of the package the expired account will be treated as a new account. Inactive accounts will remain in our system, even if they are not re-activated.</p>', 'F.A.Q', '2018-02-08 10:50:52', 'English', 'index1'),
(14, 'How to make a withdrawal request?', ' <p>A user can make ROI withdrawal request anytime, no charge is levied for ROI withdrawal.</p>\r\n\r\n                                                <p>Whereas a request for working income can be made only through an admin user account. The Working income withdrawal request can be made only on Wednesdays and Saturdays.</p>\r\n\r\n                                                <p>A deduction of 10% will be charged on working income withdrawal.</p>\r\n\r\n                                                <p>Please note that the Minimum withdrawal amount is $5.</p>', 'F.A.Q', '2018-02-08 10:50:29', 'English', 'index1'),
(15, 'What is binary income and how will it be credited?', '<p>Binary income is the income that a user will receive if he/she successfully adds on both right and left downline, at least one member each. Binary income will be automatically credited to the working wallet of the user.</p>', 'F.A.Q', '2018-02-08 10:50:06', 'English', 'index1');
